	PT _ (T_QUOTED_STRING_ITEM happy_dollar_dollar) -> cont 125#;
	PT _ (T_LIDENT _) -> cont 126#;
	PT _ (T_UIDENT happy_dollar_dollar) -> cont 127#;
	PT _ (T_LABEL _) -> cont 128#;
	PT _ (T_OPTLABEL _) -> cont 129#;
	_ -> happyError' ((tk:tks), [])
	}

happyError_ explist 130# tk tks = happyError' (tks, explist)
happyError_ explist _ tk tks = happyError' ((tk:tks), explist)

happyThen :: () => Err a -> (a -> Err b) -> Err b
happyThen = ((>>=))
happyReturn :: () => a -> Err a
happyReturn = (return)
happyThen1 m k tks = ((>>=)) m (\a -> k a tks)
happyReturn1 :: () => a -> b -> Err a
happyReturn1 = \a tks -> (return) a
happyError' :: () => ([(Token)], [Prelude.String]) -> Err a
happyError' = (\(tokens, _) -> happyError tokens)
pImplementation tks = happySomeParser where
 happySomeParser = happyThen (happyParse 0# tks) (\x -> happyReturn (let {(HappyWrap47 x') = happyOut47 x} in x'))

pInterface tks = happySomeParser where
 happySomeParser = happyThen (happyParse 1# tks) (\x -> happyReturn (let {(HappyWrap48 x') = happyOut48 x} in x'))

pUseFile tks = happySomeParser where
 happySomeParser = happyThen (happyParse 2# tks) (\x -> happyReturn (let {(HappyWrap51 x') = happyOut51 x} in x'))

happySeq = happyDontSeq


type Err = Either String

happyError :: [Token] -> Err a
happyError ts = Left $
  "syntax error at " ++ tokenPos ts ++
  case ts of
    []      -> []
    [Err _] -> " due to lexer error"
    t:_     -> " before `" ++ (prToken t) ++ "'"

myLexer :: String -> [Token]
myLexer = tokens
